const styles = {
  outer: {
    borderRadius: 5,
    boxShadow: "0 10px 30px #BBB",
    padding: 10,
  },
};
const Buy = () => {
  const { setPage } = useContext(RoutingContext);
  const { selectedTile } = useContext(selectedTileContext);

  const classes = useStyles();

  return (
    <form
      style={classes.outer}
      className={classes.root}
      noValidate
      autoComplete="off"
    >
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <TextField
            id="standard-basic"
            label="Standard"
            fullWidth={true}
            InputProps={{
              readOnly: true,
            }}
          />
        </Grid>
        <Grid item xs={12}>
          <TextField id="standard-basic2" label="Standard2" />
        </Grid>
      </Grid>
    </form>
  );
};

export default Buy;
